import React from "react";
import './CSS/Europe.css';

const Country = (props) =>{

    return(
        <div className="country">
            <svg viewBox={props.viewBox}>
                <path data-title={props.title} d={props.d}/>
            </svg>
        </div>
    )
}

export default Country;
